function ResultsListComponent() {
    const data ={

        "results" :[
          {
            "coursename":"John",
            "studentname":"Doe",
            "score":"25"
          },
          {
            "coursename":"Jack",
            "studentname":"Brown",
            "score":"24"
          },
          {
            "coursename":"Oliver",
            "studentname":"Black",
            "score":"30"
          },
        ]
      }

    return (
    <div className="container">
        <h1>Results Lists</h1>

        <tbody>
          <tr>
            <th>Course</th>
            <th>Student</th>
            <th>Score</th>
          </tr>
          {data.results.map((item, i) => (
            <tr key={i}>
              <td>{item.coursename}</td>
              <td>{item.studentname}</td>
              <td>{item.score}</td>
            </tr>
          ))}
    </tbody>

    </div>
    )
}

export default ResultsListComponent
